import React from 'react';

const FlagPw = props => (
  <svg viewBox="0 0 800 500" {...props}>
    <path fill="#4AADD6" d="M0 0h800v500H0z" />
    <circle fill="#FFDE00" cx={350} cy={250} r={150} />
  </svg>
);

export default FlagPw;
